import React, { useState, useEffect } from "react";
import Categories from "./components/Categories/FormCategories.js";
import Products from "./components/Products/Products.js";
import { BrowserRouter, Route, Switch } from "react-router-dom";

function App() {

  useEffect(() => {
    if (JSON.parse(localStorage.getItem("parameters"))) {
      handlerSearch(JSON.parse(localStorage.getItem("parameters")));
    }
  }, []);


  return (
    <div className="App container">
      <BrowserRouter>
        <Switch>
          <Route
            exact
            path="/"
            render={() => <Categories/>}
          />
          <Route
            path="/info/:contry/:categorie"
            render={() => <Products/>}
          />
        </Switch>
      </BrowserRouter>
    </div>
  );
}

export default App;
